import React from "react";

const MovieForm = (props) => {
  return (
    <React.Fragment>
        <br/>
      <h1 className="backk">Movie Form <span className="badge-danger">{props.match.params.id}</span></h1>
    </React.Fragment>
  );
};

export default MovieForm;
